\r\nIntended Learning Outcomes being assessed\r\n \r\nBy the end of this course students will be able to:\r\n1. Understand and explain the differences between shareholder and stakeholder capitalism as well as alternative approaches found in mixed or non-capitalist economies.\r\n2. Identify the most intensely controversial aspects of contemporary management and leadership.\r\n3. Explain the significance of contextual conditions, and especially the impact of organizational and environmental turbulence on management issues and controversies.\r\n\r\nTASK 2:\r\nReport: 2,500 words â€“ 75% weighting. \r\nUsing any analytical framework of your choice, identify three top management controversial issues facing an organization of your choice. Set out a management plan to manage or mitigate the controversial issue within the selected organisation.\r\n \r\n \r\nAssessment criteria\r\nThis assignment invites students to think about the relative importance of different sections of the management. The are no â€œrightâ€ or â€œwrongâ€ choices, but what is very important is the argument presented to justify the choices provided. This assignment is intended to establish a benchmark for each student to compare and contrast their view at the start and upon completion of the class.\r\n\r\n \r\nCourse Rubric\r\nPlease note that this rubric is intended to inform the marking process and NOT be a definitive guide to any final grade which is, in essence, based on the academic judgement of the marker.\r\nCriteria\r\nExcellent/Very Good B-A Grade\r\nGood C grade\r\nSatisfactory\r\nD1-D2 Grade\r\nWeak-Poor\r\nD3, F-E Grade\r\nContents/Materials\r\n- Quality of contents\r\n- Depth and relevance of Refection\r\n- Level of individuality\r\n- Self-critical analysis\r\n- Connections between concepts and examples.\r\nVery deep, honest and critical reflection that uses specific and convincing examples from personal experience to make and support claims.\r\nStrong evidence of learning that links clearly to a well set-out development plan and specific areas for changes/ improvement of future performance.\r\nSelf-critical analysis is articulated, and brings out specific personal insights from the experience.  \r\nStrong applicable connections shown between relevant concepts and examples.\r\n \r\nDeep reflection with clear relevant examples from personal experience to support claims.\r\nVery good evidence of learning that is linked to a development plan for changes and improvement.\r\nGood level of self-critical analysis with personal insights drawn.\r\nShows good evidence in the connection between concepts and examples.\r\nThe reflection is largely relevant and reasonable deep with some examples provided to support claims.\r\nSome evidence of learning with consequences for actions mentioned.\r\nSome evidence of a personal development plan with self-critical analysis though falls short in details.\r\nMake clear attempt in integrating concepts and examples.\r\nThe reflection is mostly irrelevant to the project, or it merely scratches the surface with inadequate or vague examples that only partially support claims.\r\nMore of a report/ description of events and activities than a self-reflection.\r\nLimited evidence of self-critical analysis (e.g. of own knowledge, assumptions/ stereotypes, and actions; and of the literature drawn upon).\r\nLimited evidence of learning and its connection to personal development plan.\r\nWeak connections between concepts and examples.\r\n \r\nStructure, Formatting and Presentation\r\n- Written in first person\r\n- Concise writing\r\n- Absence of typographical and grammatical errors\r\n- Legibility, structure and flow of text\r\nContents are very professionally laid out and formatted.\r\nStructure is clear with precise sectioning; and the flow of contents is logical and coherent.\r\nArticulated first-person narrative.\r\nWriting is precise, sophisticated and engaging to read.\r\nShows clear evidence of care and attention to avoid typos and grammatical errors.\r\n \r\nContents are clearly structured and sectioned into a coherent flow.\r\nWritten in first person narrative.\r\nWriting is succinct and sentences are mostly structured effectively.\r\nShows evidence of care and attention to avoid typos and grammatical errors.\r\n \r\nContents are appropriately structured, and flow of thoughts could be followed and understood.\r\nMostly written in first person narrative.\r\nWriting is reasonably clear.\r\nSome minor typos and grammatical errors, but overall presentation is clear.\r\nContents are weakly structured and the flow disorganised.\r\nLimited first-person narrative.\r\nWriting is winding and redundant, and sentence structure is often confusing.\r\nShows little evidence of planning the layout and format, and of care to spot and correct typos or grammatical errors.\r\n \r\n \r\n', 'Msc', 'Masters', '[\"Essay Writing\",\"Review Article\"]', '[\"Management\"]', '2023-04-24 12:00', 'Negotiable', 'Task 2 (MIC) 2.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
