(940, 1022, 'Commerce', 'Innovation and global competition', 'Choose a contemporary â€“ preferably disruptive/radical â€“ innovation (less than 10 years old) or social innovation that you find interesting, and carry out research and/or conduct an analysis of the innovationâ€™s model and its scalability. It is important that you do not choose a company or innovation that is already well-established and has significantly scaled such as Google, Amazon, Facebook etc. The length of the essay should be no more than 2,000 words, excluding acknowledgements, references, and appendices.\r\nThe essay should demonstrate your understanding of the conceptual frameworks and topics discussed in this module, and how the frameworks might be applied in the analyses of the chosen innovationâ€™s model. The coherence of the essay structure, and clarity in the overall presentation of the argument, as well as the appropriate use of literature and cases to support your argument, are essential.', 'msc innovation and entrepreneurship', 'Masters', '[\"Essay Writing\"]', '[\"Marketing\"]', '2023-04-25 15:00', '3000', 'BUSM177 Assessment Two - Individual coursework.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(941, 1023, 'Commerce', 'New product development', 'Students should address one of the eight questions below and submit the coursework according to the instructions indicated at the bottom of this document. The questions should be addressed in 2500 words. Essays should be uploaded to QMPlus via the Assessment Tab no later than 3pm 26th April 2023. Essays MUST include relevant literature from the module. Failure to do so will see marks capped at 50.\r\n\r\n\r\nQuestion 1\r\n\r\nUsing relevant material and examples, define platforms and their configurations, and analyse how platform leaders leverage modular architectures to exert platform leadership. \r\n\r\nQuestion 2\r\n\r\nEcosystems can be defined as constellations of platforms. By referring to the relevant \r\nliterature analysed during the module (such as Jacobides, et al 2018) explain the difference between markets and ecosystems and how non-generic complementarities shape ecosystemsâ€™ governance. \r\n\r\n', 'msc innovation and entrepreneurship', 'Masters', '[\"Essay Writing\"]', '[\"Marketing\"]', '2023-04-20 15:00', '4000', 'BUSM084 20223 essay questions New Product Development and Business Ecosystem (7).docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
