(964, 1047, 'Commerce', 'Essay for Corporate Social Responsibility and Business Ethics', 'Submit an essay on 1 of the 2 assignment questions. The essay should be of 2500 words (excluding references). The questions are as follows:\r\n\r\nQuestion 1\r\nChoose one stakeholder group (shareholders, workers, consumers, suppliers, civil society organisations) and identify the main ethical issues that shape their opportunities and challenges in relation to corporate activity.\r\n\r\n\r\n[100 marks]\r\nQuestion 2                                                                                                                      	\r\nReflecting on what you have learnt over the course of this module, \r\n\r\nA. Describe how your understanding about the responsibilities of corporations to society has changed and/or been challenged. \r\n\r\n[50 marks]\r\n\r\nB. What potential solutions, if any, do you believe can ensure a more sustainable and ethical way of doing business in the future? Refer to specific case studies and examples that you have learnt in class.\r\n\r\n[50 marks]\r\n', 'Msc Management', 'Masters', '[\"Essay Writing\"]', '[\"Corporate social responsibility\"]', '2023-04-18 21:00', '4000-5000', 'BUSM175 Individual essay FAQs.docx_$_BUSM175 individual coursework questions.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
