(969, 1053, 'Arts', 'Report on performance data accumulated over three year of trading with in hots business simulation, The report should consist of two parts. Part 1 of the report should analyse two out of five KPIs relevant to your dept. Use performance data from our dept. accumulated over the three-year period within the HOTS simulation. Part 2 of the report should use academic theory to provide a critical reflection on two strategies related to your performance analysis in part 1.', 'The report will be limited to 3,500 words (5% margin either way) excluding appendices.\r\nIt should comprise of a cover page, executive summary, analysis and conclusion.\r\nStudent can use a maximum of two appendices to support the analysis, otherwise all relevant graphs and tables should be used in the main body of the report. It is expected that students will be selective in choosing which reports are relevant to support your analysis.\r\n\r\nasslgnment when submitted should not Include your name - we use a system of anonymous marking to reduce the riak of any unconsclous blas. For some authentic assessments, there may be an exception to this, so please confirm with your Module Leader.\r\nThe authentic and essential requirements for this plece of assessed work are;\r\nâ€¢ It must be word-processed in 11-point Arlal font and double-spaced\r\nAll pages must be numbered\r\nMargins must be as follows: Top: 1 inch, Bottom: 1 inch (2.5 cm). Left: 1.25 inches, Right: 1.25 inches (3.2 cm)\r\nAs this is an electronic file submission, give the file, which you intend to upload a name, which begins with your student number.', 'International hospitals ,events & tourism ', 'Masters', '[\"Report Writing\"]', '[\"Hotel Management\"]', '2023-04-23 09:51', 'Rs 2000', 'image.jpg_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
