(76, 87, 'Commerce', 'Firms in International trade ', 'Need to write 400 words essay \r\nRemember to address all aspects of the marking criteria:\r\n-	*Identifies appropriate links to sample seminar question \r\n-	Summarises article/ chapter argument precisely \r\n-	Summarises methodology and data/ empirical findings accurately \r\n-	Critically evaluates article/ chapter argument and/ or methodology \r\n-	English Usage\r\n[*Note â€“ sample seminar questions link more closely to some readings than others, make appropriate links where possible but you will not be penalised if there is not an obvious link.]\r\nNo referencing is required in your seminar log as it is expected that you will focus on your chosen reading, although you may indicate page numbers where you are referring to a specific point from your chosen reading. Do not copy and paste tables or figures from the chosen reading â€“ explain them in your own words. Follow the format and structure suggested in the model seminar log â€“ use 11- or 12-point font and double-spaced text.', 'International Business ', 'Masters', '[\"Essay Writing\"]', '[\"Business & Accounting Studies\"]', '2022-03-02 14:40', '500', 'jep.21.3.105.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
