(98, 111, 'Commerce', 'Effect of family communication patterns on adolescents self-esteem ', '1). Scoring-The data will be approximately of 100 responses.\r\n2). Statistical Data Analysis-Analysis of the demographic variables (mean, median, mode, standard deviation, etc). And hypothesis testing with probably t tests, or correlation tests. Can be done using Microsoft Excel or R studio/software. \r\n3). Interpretation-The analysed data in numeric values translated with explanation and interpretation.', 'Psychology', 'Masters', '[\"Dissertation Writing\"]', '[\"Data analysis,Data Analysis with Excel, Access and,Data Analysis in R/Python,Data analysis R programming,Scoring,Interpretation\"]', '2022-03-21 17:00', '2,000/- to 3,000/-', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
