(110, 123, 'Arts', 'New Super Market Designing', 'Designing an Operational Strategy and Road Map for an upcoming Super Market branch in comparison to the peers.\r\nPoints to be covered at the first step:\r\nWe are going to create a new supermarket (covering all the products like food, groceries, apparel, appliances, etc.) at Chandigarh (Tier 2 city market) and it will be a physical store only. \r\nA)	So, you need to do competitors analysis on DMart and More (Existing supermarket at Chandigarh).\r\nB)	And also need to cover the problem statement for a new supermarket which are below mentioned:\r\n1.	Is It going to be bootstrap 25% each(Suppose we are 4 partners)  or taking a bank loan or external financial support from the fund or non-banking agencies (fundraise, investors, etc.)?\r\n2.	What kind of framework does a supermarket work on?\r\n3.	What kind of USP will the supermarket have?\r\n4.	Why should people prefer our supermarket over another supermarket?\r\n5.	What is the goal of this particular supermarket?\r\n6.	Why do you want to open this supermarket even a location and town that of your choice?\r\n7.	What do you expect the supermarket to achieve?\r\nC)	 Operational challenges faced by the existing supermarkets (DMart, More, etc.) (by taking a deep dive into the history for the past 20 years)\r\n', 'MBA', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"Primary / Secondary Data Analysis\"]', '[\"Research Methods\"]', '2022-03-15 17:00', 'Negotiable', 'New Supermarket Designing.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
