(112, 125, 'Engineering', 'Face Mask Detection Syatem', 'We want to make an AI system that detects when a person is wearing a mask or not and sends notifications on an app/website. This will be used in an office set up so we want employees to be notified, and after 3 warnings a penalty should be deducted. The app/website should be made using React JS. We want the frontend and backend made and then integrated with AI models which will be provided', 'information Technology', 'Bachelors', '[\"Programming / Coding Assignment\"]', '[\"App Development,Machine Learning,Web Design and Development\"]', '2022-03-18 14:25', 'Rs. 4000 ', 'Face_Mask_Detection_AI&Website.docx_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
