(157, 174, 'Commerce', '6MK013 Consumer behaviour and the responsible marketer', 'The case study is Nykaa.  You should agree the new product / product category to discuss with your tutor.\r\n \r\nNykka is planning to launch a new product / product category within the next six months, and you have been asked to identify an appropriate segment to target with the new product /category.  You should also discuss the issues to be taken into account in terms of consumer behaviour theory and models that are applicable to the segment. The specific issues you should address are outlined in the details below.\r\n \r\nStudents should write a report for the board recommending the approach to be taken addressing how to segment the audience; how to appeal to the audience; and ethical and social issues to consider.   A suggested structure for the report is below:\r\n \r\n1. Introduction: a brief explanation of the organization and the product/ product category to be launched (100 words)\r\n2. Suggested segmentation approach: students to suggest how the market could be segmented and recommend one segment to pursue.  Evidence of relevant market research and application of segmentation theory and models is required.  (900 words)\r\n3. Key issues and influences: students to identify and discuss key issues and influences on the purchasing behaviour of the chosen segment.   For example, students may identify and analyse individual, social / cultural influences.   Students should then discuss how these issues may impact on future marketing plans / strategy, making recommendations which take into account consumer behaviour theories and approaches â€“ eg motivation theory, social/ group influence. (1300 words)\r\n4. Students to discuss any ethical issues relating to the potential consumers and highlight issues to be addressed in order to ensure a socially-responsible and ethical approach is adapted (600 words)\r\n5. Conclusion (100 words)', 'Bachelors in Association with Business Management specializing in Marketing ', 'Bachelors', '[\"Essay Writing\",\"Report Writing\",\"Research Paper\",\"Primary / Secondary Data Analysis\",\"Case Studies\"]', '[\"Market Research,Market analysis,Marketing Analytics,Marketing and sales\"]', '2022-04-08 21:30', '3,000 - 5,000', '6MK013+Assessment+brief+2021-22+-+Podar.doc_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(158, 175, 'Commerce', 'Knowledge spillovers, trade and foreign direct investment ', 'Write a 400 words essay. No referencing is required in the essay  as it is expected that you will focus on your chosen reading, although you may indicate page numbers where you are referring to a specific point from your chosen reading. Do not copy and paste tables or figures from the chosen reading â€“ explain them in your own words. use 11- or 12-point font and double-spaced text. Remember to address all aspects of the marking criteria:\r\n-	*Identifies appropriate links to sample seminar question \r\n-	Summarises article/ chapter argument precisely \r\n-	Summarises methodology and data/ empirical findings accurately \r\n-	Critically evaluates article/ chapter argument and/ or methodology \r\n-	English Usage', 'International Business ', 'Masters', '[\"Essay Writing\"]', '[\"Business & Accounting Studies,Business administration\"]', '2022-03-30 17:30', '500', 'w28739.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
