(167, 187, 'Engineering', 'Social networking platform for Healthcare professionals with e-Health Services', 'we need to design an application in flutter using firebase at the backend for final year project. The main aim of the application is to build a platform which consist of social network to keep healthcare professionals(HCP) connected along with it provide eHealth services .The users of the system are Doctors, Medical students, and normal user. So, basically the system is divided into two parts 1- social networking part which consist of post section(only HCP can post health related information),general forum wherein all the users can discuss , HCP forum (Only Doctors and medical student can discuss). 2 - eHealth services which consist of bed booking and ambulance booking.', 'Engineering', 'Bachelors', '[\"Other\"]', '[\"Dart,App Development,flutter,Firebase\"]', '2022-04-07 14:02', '8000', 'figma ui design.docx_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
(168, 188, 'Commerce', 'Branding: Effective Strategies to Provide a Competitive Advantage for International Businesses ', 'Need to write a project report/dissertation with secondary research for effective strategies for International brands to gain a competitive advantage by either standardising the brand or customising/ adapting the brand based on the market they are expanding into. \r\n\r\nCan include terms from Hofstede Model,  Adaptation and Standardization Strategies, Competitive Advantage through Branding, Cultural Factors, India as a Market, etc.\r\n\r\n\r\nI have done the literature review, and have written some parts of the paper briefly. \r\nI can share the links to the papers I have researched. \r\n\r\nBasic Format:\r\nABSTRACT\r\nINTRODUCTION\r\nLITERATURE REVIEW\r\nMETHODOLOGY\r\nRESULTS\r\nINFERENCES \r\nLIMITATIONS\r\nFUTURE SCOPE\r\nPRACTICAL IMPLICATIONS\r\nEXAMPLES/ CASES\r\nSOLUTION\r\nREFERENCES\r\n\r\nExpectation: around 20k words.\r\nFirst draft due (Hard deadline): 7th April\r\nFinal Draft (Hard deadline): 13th April\r\n', 'Postgraduate Diploma in Business Studies (Marketing)', 'Diploma', '[\"Dissertation Writing\"]', '[\"Branding\"]', '2022-04-07 12:30', '8,000 - 10,000', 'Progress Report- Aman Jude.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
