(185, 207, 'Commerce', 'Hotel ambasaddor - IHCL Selecqtions', 'Marketing assignment 2\r\n\r\nReport\r\n\r\nFormat:\r\n	âƒ	Executive summary\r\n	âƒ	TOC\r\n	âƒ	List of tables\r\n	âƒ	List of annaxures\r\n	âƒ	List of diagrams, charts\r\n	âƒ	List of graphs\r\n	âƒ	List of acronyms\r\n\r\n	1.	intro (300)\r\n	2.	Needs and expectation\r\n	3.	RMSP\r\n	4.	IMC\r\n	5.	Conclusion\r\n	6.	Recommendation\r\n	7.	References\r\n	8.	Annexes \r\n\r\n\r\n	âƒ	Part a b c (2400)\r\n	âƒ	Conclusion (150)\r\n	âƒ	Recommendation (150)\r\n	âƒ	Referencing\r\n	âƒ	annexes (summary of swot analysis)\r\n\r\n\r\n\r\nï¿¼\r\n\r\n\r\n\r\nWhat is a marketing plan (research on this)\r\n\r\n\r\n\r\nA-situation analysis (swot and 4Ps of company)\r\n       Define customers\r\n       New STP\r\n       \r\n(Current company situation/survival story) (google and articles, about page of company)\r\n     \r\nMarketing mix\r\nStp\r\nCompetition analysis\r\nSWOT\r\n(Above 4 on current situation and the detailed working of it to be in the annexes. Images and tables can be added)\r\n\r\n(Needs and expectations of consumers pre covid and post covid)\r\nNew STP  \r\n\r\n	2.	Where are we now?\r\n2.1 5 Ss (company situation and marketing mix)\r\n2.2 Customers instinct\r\n2.3 SWOT\r\n2.4 Broad perception\r\n2.5 Capabilities and resources \r\n\r\n\r\n\r\n\r\nB-role of marketing in strategic planning \r\n     Goals and objectives\r\n     Ideate marketing mix\r\n     Ideate marketing strategy\r\n(Refer reference book chapter 4)\r\nï¿¼\r\n\r\nï¿¼\r\n\r\nCheck marketing warfare \r\nWrite about the core marketing idea\r\n\r\nIOT as a part of Orange County (marketers challenge in the digital world) (marketing 5.0 so no social media) (marketing strategy) \r\nCookies on website of example when it is used on the online menu \r\nWhat kind of experience do you want to promote will be the core idea of this part \r\nExample if you want to give offers, the theme is to be explained in the part b but the offers are to be mentioned in the part c (the theme has to be of 1-3 months)\r\nYou can come up with a brand differentiation strategy or come top with a new product. \r\n\r\n\r\nC- integrate marketing communication\r\n      Marketing calendar\r\n      Marketing budget\r\n      Marketing practices and plan \r\nDigital display advertising- advertisement copy (make one ad based on marketing idea of part b)\r\nShould focus on influencer marketing, SEO and social media (or you can write that you are hiring a digital marketer)\r\nCreate a marketing careener (eg: Facebook post this on this day, etc etc for 1-3 months) (Facebook scheduling strategy google it )\r\nMake the budget for calendar \r\n\r\n(The poster of advertisement would be in the Annexure and only the explanation in the assignment and the calendar would be in the main assignment itself )\r\n\r\n	1.	Understand what is situation analysis (pg. 629, 630 from the book principles of marketing)\r\n	2.	Do a competitive analysis of your company (no of competitors depend on you)\r\n	\r\n\r\n', 'Hotel management', 'Bachelors', '[\"Report Writing\"]', '[\"Marketing management\"]', '2022-04-12 10:30', '3000', 'Document (1).pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
