(190, 212, 'Engineering', 'CVEdB (Common Vulnerabilities and Exploits Database)', 'A Research paper of about 6 pages on my major project CVEdB. \r\nNeed, these sections in my paper : Abstract, Introduction, Literature Review/Related Work, Proposed System, Results and Future Scope, Conclusion, References\r\n\r\nIn the application User enters a CVE Id and the page outputs - \r\n>CVE Title \r\n>CVE Overview - CVE Short Info\r\n>CVSS Score - We are showing the Base score and a user friendly chart for user to understand from the CVSS Attack Vector.\r\n>Exploit Link - An exploit to target the CVE that user has entered, from where we are scraping the Exploit from, the site.\r\n>Exploit Code - The exploit Code for simplicity, instead of visiting the Exploit Link and copying the code from there, we copy the code here\r\n>Exploit Price - When the CVE was first introduced, the price for exploiting this CVE. A 0-day attack price and the current price for exploiting this CVE.\r\n>CounterMeasure - A countermeasure to patch this CVE affecting an org or a simple vendor.\r\n>Capec Solution - Solution on how to not make the mistake while making a software that leads to this CVE.\r\n>Vulnerable Products - Various software products that are affected from this CVE\r\nA Comment Section - A simple comment section for users.', 'Engineering', 'Bachelors', '[\"Research Paper\"]', '[\"Computer Science and Engineering,cybersecurity,Information security\"]', '2022-04-12 13:04', '1000', 'Finished Major Project With 3 Examples-1.m4v_$_paper 5.txt_$_Paper 4.pdf_$_Paper 3.pdf_$_Paper 2.pdf_$_(Base) Paper 1.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
