(204, 227, 'Commerce', 'Marketing Application ', 'Critical debate paper (approx. 800 words)\r\nYou will write a fully-referenced essay that that addresses the widely-debated question â€œIs marketing a force for good or evil?â€  You should explain and justify, based on your reading of relevant literature, your personal position on the debate as to the influence of marketing on society.\r\n  \r\nâ€¢	A â€œcritical debate paperâ€ means that you must provide a critical evaluation of the issue under investigation â€“ not just â€œwhat you thinkâ€ â€“ thus, you should base your views around a central argument and undertake appropriate reading and research to support both the â€œforâ€ and â€œagainstâ€ positions for that argument. \r\n\r\nâ€¢	â€œFully-referencedâ€ means that your analysis MUST be supported by an absolute minimum of SIX references, THREE of which should be from academic journal papers and THREE from reputable, trustworthy sources.  \r\nGiven the wide scope of marketing ethics, it is suggested that you focus on one particular issue, for example one of the following:  environment and sustainability; healthy eating and obesity; marketing to children and vulnerable consumers; sex in advertising; shocking and offensive advertising; gambling and advertising\r\nReflective statement (maximum 200 words)\r\nAt the end of your essay you should include a statement that reflects upon the way you went about doing this piece of assessment and what you learnt from it, for example: \r\nâ€¢	How did you assure the trustworthiness of your source material, e.g. why are you confident about the reliability of the sources and the credibility of the authors you have cited in your work?\r\nâ€¢	What did you learn about yourself while doing this exercise? \r\nâ€¢	How could you use the learning from this exercise in your future assessments? ', 'BBA Honours ', 'Bachelors', '[\"Research Paper\"]', '[\"Marketing\"]', '2022-04-13 09:00', '1500', '_$_', '2023-05-09 21:16:59', NULL, NULL,