(206, 229, 'Engineering', 'FINGER PRINT BASED ATM SYSTEM', '\r\n     Fingerprint verification is to verify the authenticity of one person by his fingerprint. The  user provides his fingerprint together with his identity information like his PIN-CODE.  The fingerprint verification system retrieves the fingerprint template according to the  PIN-CODE and matches the template with the real time acquired fingerprint from the  user. Usually it is the underlying design principle of AFAS (Automatic Fingerprint  Authentication System). Fingerprint identification is to specify one personâ€™s identity by  his fingerprint(s). Without knowledge of the personâ€™s identity, the fingerprint identification system tries to match his fingerprint(s) with those in the whole fingerprint  database. It is especially useful for criminal investigation cases. And it is the design  principle of AFIS (Automatic Fingerprint Identification System). However, all  fingerprint recognition problems, either verification or identification, are ultimately  based on a well-defined representation of a fingerprint. \r\n\r\n', 'Engineering', 'Bachelors', '[\"IOT/Hardware Projects\"]', '[\"IOT\"]', '2022-04-16 10:15', '8k', 'final year project ppt.pptx_$_final year project report .docx_$_be it project guidline .pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 0, 0, 0, 0),
