(219, 242, 'Commerce', 'What role does technology play in generating uneven economic development, and how are multinationals implicated in it?', 'Essay Instructions and Marking Criteria\r\n\r\nYour essay must conform to the following criteria:\r\n\r\nâ€¢	Times New Roman font\r\nâ€¢	Double-spaced \r\nâ€¢	A maximum of 3,000 words. This does not include your list of references. \r\no	I really mean 3,000 words as a maximum â€“ there is no +10%!  \r\nâ€¢	While you have some leeway to interpret your chosen question as you see fit, make sure your approach engages with core course material. One major aim of the essay is to gauge the extent to which you have internalized key ideas in readings and lectures. So make sure your essay satisfies this. \r\nâ€¢	Theory is especially important.\r\nâ€¢	Write as if your intended reader was a generally intelligent and informed non-expert. Do not assume key ideas; instead explain them clearly from first principles. If they are crucial, be sure to go in sufficient depth.\r\nâ€¢	Follow appropriate referencing and bibliography. In seeking sources, a useful starting point would be the reading lists provided for this course. A logical next step for deepening your knowledge would be the bibliographies of those works.\r\nâ€¢	The use of a wide variety of relevant academic (ie peer-reviewed) sources is expected. \r\nâ€¢	There is no magic â€˜rightâ€™ number of sources, and quality is preferred over quantity.\r\nâ€¢	Clarity of expression is very important. If English is not your first language, make sure to have your paper proofread by a native speaker.  SBM has a writing tutor â€“ Kyla Sankey, who can help. \r\nâ€¢	Essay structure matters. Make sure your introduction indicates your thesis. Have a plan, make it explicit to the reader, and follow it.\r\nâ€¢	Having a well-articulated thesis statement in your introduction will help to structure your argument and provide a roadmap to the reader. If you are not well-practiced in writing thesis statements, I suggest you seek guidance. SBMâ€™s writing tutor will be helpful. Online sources might also help, such as\r\no	https://writingcenter.unc.edu/tips-and-tools/thesis-statements/\r\no	https://www.servicescape.com/blog/25-thesis-statement-examples-that-will-make-writing-a-breeze', 'International Business ', 'Masters', '[\"Essay Writing\"]', '[\"Business (AS & A level)\"]', '2022-04-20 19:00', '2000', 'Essay Instructions and Marking Criteria.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
