(244, 270, 'Commerce', 'Culture and International Business ', '1. Write a real-life case study where you had exposure to a different culture \r\nthan your home culture and where you had to overcome differences in cross-\r\ncultural communication.  Critically analyse what were the sources of these \r\ndifferences and the difficulties you may have faced, using three models of \r\ncross-cultural communications that were taught in the module.  Reflect on \r\nthese difficulties, how did you overcome them and what would you have \r\ndone differently next time.  You may choose a personal experience from your \r\npast, or you may reflect on your experience working on the Assignment 1 \r\nBaytree Centre Live Brief.\r\n2. A hypothetical Indian company is considering entering an emerging market, \r\nGermany or the USA. The type of company including industry, size and \r\nproducts is up to you, but you will need to state clearly in your introduction \r\nthe characteristics of your hypothetical company.  Write a business report for \r\nthis companyâ€™s top management detailing how the assessment of \r\nopportunities in these two countries should be done (i.e., what models, \r\nfactors or data need to considered/included in the assessment). Discuss how \r\nthe company could choose an appropriate entry mode using John Dunningâ€™s \r\nEclectic Paradigm to show how to enter the chosen country.', 'BBA Honours ', 'Bachelors', '[\"Report Writing\"]', '[\"Culture and art\"]', '2022-04-22 18:00', '3000', 'BS5201M 2021-22 Assignments 3 only.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
