(327, 362, 'Commerce', 'Research Report on Inventory Management', 'Q1. What is inventory management?\r\n       What are the features should inventory management have in todayâ€™s market?\r\n\r\nQ2. What are the five major inventory management types followed by Indian inventory management companies? (I.e., What are the 5 significant types of inventory management used in India or Indian market or Indian companies.\r\n\r\nQ3. On the top 5 inventory management solution providers, you have to prepare a detailed comparison report followed by a chart report.\r\n', 'MBA', 'Masters', '[\"Report Writing\",\"Primary / Secondary Data Analysis\"]', '[\"inventory management\"]', '2022-05-25 11:00', 'Negotiable', 'Research report on Inventory Management.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(328, 363, 'Arts', 'Analysis of statistical Data ', 'This should not exceed 1,500 words and should be typed in double-line spacing following APA format (American Psychological Association Publication Manual 7th Edition, 2019).  Tables, figures and references are not included in the word count.  \r\nThe PPSQ was given to 300 adolescents (aged between 13 and 16) who were identified by their school as having potentially high levels of anxiety.  Load the SPSS data file: â€˜â€˜Adolescent attitudesâ€ (in blackboard).  Check and prepare the data, then carry out a factor analysis to explore the factor structure of the PPSQ.  Also check and report the internal reliability of the factors identified in your final solution. Write up your results formally (using APA format), briefly describing the purpose of the task, describing in detail your analysis method choices (including why you have chosen these over the other types), checks, decisions, results and interpretations along the journey of your analysis. Then present the full details of your final solution, clearly and coherently, and conclude the findings of the task. \r\nTip: You need to provide enough information so that your analysis can be replicated, and you should describe and justify the decisions and changes you make, and the outcomes. Within your write up, make sure you report all relevant statistics. Compare any different models you have carried out, explaining what you did differently, what you found, and which analysis provides the most sensible and reliable solution. \r\nNote: You are not required to write any introduction, method, or discussion sections, and you are not required to look at any literature about parental support\r\n', 'Psychology', 'Masters', '[\"Report Writing\"]', '[\"SPSS Statistics,Research Methods,Psychological statistics\"]', '2022-05-26 12:00', 'GBP 25-30', 'RESM6011 Assignment Details_21-22.docx_$_RESM6011_18-19_Adolescent Attitudes (1).sav_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1