(621, 683, 'Arts', 'PR Campaign Analysis', 'For this assessment you write a 1000 word analyses, selecting a campaigns and in each case focusing on a PR text as your object of study in each case. The campaign could be for any entity â€“ an individual, group, company, political party, charity/NGO, government, etc. The texts can be a press release, a press conference, a series of media articles that draw heavily on a press release, an event, interview, or even a series of tweets.\r\nUse one or more of the existing critical/theoretical approaches to public relations and apply it/them to your object of study. It is important to provide a critical analysis of your objects of study, rather than simply describe them. You ought to explain how the object of study attempts to persuade or to set the agenda, using the techniques of public relations.\r\n\r\nYou must write your analysis drawing on relevant academic sources to offer depth to your argument.', 'MA Media and PR', 'Masters', '[\"Essay Writing\"]', '[\"Public Relations\"]', '2022-11-16 22:00', 'INR 2000', '_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
(622, 684, 'Commerce', 'Strategic management ', 'Streaming Video on Demand (SVoD) is a challenging industry with multiple competitors emerging over the \r\ncourse of the last few years. . You will produce a report for a SVoD company of your choice  (for example, you \r\ncould choose one of the following companies: Netflix, Disney+, Apple TV+, Amazon Prime Video, ...).  \r\nFocus on a particular geographic market (this could be Global, or the UK, US or any other market). \r\nYou are a management consultant for the chosen company. You need to produce an industry analysis report for \r\nthe top managers of the company. \r\nReport needs to answer the following questions: \r\nQ1 â€“ Perform PESTEL analysis of the wider macro environment.  \r\nQ2 â€“ Perform Five forces analysis of the industry. \r\nQ3 â€“ Perform internal analysis of the company. Use VRIO framework to assess its internal capabilities. \r\nQ4 â€“ Summarize main strengths, weaknesses, opportunities and threats your chosen company is facing in a \r\nSWOT matrix. Advise the companyâ€™s leadership what they can do to exploit opportunities and counter threats. In \r\nother words, provide strategic advice for the future. ', 'BBA Honours ', 'Bachelors', '[\"Essay Writing\"]', '[\"Strategic Business Management\"]', '2022-11-23 00:00', '2500', 'BS6201 Strategic management - Industry analysis assignment brief 2022-23.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(623, 685, 'Engineering', 'Assignments ', 'I want my assignments to be written on one sided A4 sheets with blue and black pen with necessary diagrams. Iâ€™ll be providing you the content of assignments and want it to be done til 21st november.', 'Chemical engineering ', 'Bachelors', '[\"Essay Writing\"]', '[\"Process dynamics and control,Petroleum and refinery,Chemical Process Equipment Design,Plant Utility\"]', '2022-11-21 22:00', 'Nil', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 1, 0),
(624, 686, 'Arts', 'Assignment- Reading Reflection', 'Students will write one reading reflection over the course of the semester (800 words). Each reading reflection should engage critically with the required reading for the selected week; as well as one additional reading from the weekly list. This should not be a summary; students should develop their own argument from the readings that discusses the main arguments of the readings, the points found to be convincing, and those that are unconvincing, with reasons. Additional research is not required, but students should be very careful to stick to the topic and avoid unsubstantiated statements. The reflection will be submitted on Brightspace before the start of class, and presented in small groups each week. The schedule for reading reflections will be arranged in the first class. Official citations, bibliography and page numbers are not required unless you draw on work outside the assigned readings. You may not use extensive quotes in your reflections. You are expected however to acknowledge the author to demonstrate you are engaging with their work (i.e.â€œas Murphy argued, market power...â€). Include 2-4 probing discussion questions to stimulate discussion in class.\r\n\r\nAPA bibliography ', 'Social Science', 'Bachelors', '[\"Other\"]', '[\"Social Science\"]', '2022-11-21 12:00', '2000', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
