(634, 696, 'Commerce', 'National Express Plc', 'You are required to conduct an in-depth analysis of the companyâ€™s financial performance and position, using information from their annual report and other relevant sources of information. This analysis should conclude with a recommendation based on one of the following scenarios (Your allocated company and scenario will be communicated separately):\r\n\r\n	a) Should a loan application for the company be granted by its banks?  or\r\n	b) Should an equity investor purchase the companyâ€™s shares?', 'Masters in finance and accounting FT', 'Masters', '[\"Report Writing\"]', '[\"Financial statement analysis\"]', '2022-11-23 23:00', '6000', 'FSA coursework brief (2).docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(635, 697, 'Engineering', 'Homework Assignment', 'This Homework is a follow-on to Homework 3 in which we will add an inheritance component to the Book portion of the application. This will require modifications to both the design and code components of the previous assignment. The details are provided below.\r\n\r\nYou should create a new class called LibraryItem that will be the base class for the inheritance tree. It should contain at least the following data elements\r\n\r\n1. ID #\r\n2. Cost\r\n3.Status (In, out, lost)\r\n4.Loan period(how long it can be checked out for-note this could be 0)\r\n\r\nIt will also need appropriate accessor and mutator functions. You may also add additional data elements if needed.\r\n\r\n \r\n\r\nThen there will be three child classes of Library Item\r\n\r\nBook should contain the other items that we previously in the Book class not included above, at least:\r\n\r\n1. Title\r\n2. Author\r\n3.ISBN Number\r\n4. Category (Biography, Fiction, SciFi, History, etc.)\r\n\r\nAudio CD should contain at least:\r\n\r\n1. Artist\r\n2. Title\r\n3.#Tracks\r\n4. Release Date\r\n5.Genre (Pop, Classic Rock, Classical, Christian, Jazz, New age, etc)\r\n\r\nDVD should contain at least:\r\n\r\n1. Title\r\n2. Category (Action, SciFi, Drama, etc.)\r\n3. Run time\r\n4. Studio (Marvel, Pixar, Disney, etc.)\r\n5. Release Date\r\n\r\nImplement the child classes, including virtual functions. Update the collection class be a heterogeneous collection using virtual functions and run-time polymorphism.', 'CS', 'Bachelors', '[\"Programming / Coding Assignment\",\"Question and Answer Based\"]', '[\"Computer Science and Engineering\"]', '2022-11-21 22:30', '3500', 'hhrhw3 2.zip_$_CSCE 1040 Homework 2-1 (4) (1).docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
