(757, 827, 'Arts', 'Health care system in Jaipur is better than patan village', 'The dissertation written material needs to be of 10000 words. There needs to be introduction, about the area , research methodology, data analysis, literature review, conclusion and annexure and webliography references everything needs to be attached. I will provide information wherever necessary', 'Ba', 'Bachelors', '[\"Dissertation Writing\"]', '[\"Health-care,health-care-system-in-India,urban-rural-health-care-system-diffrences,Research Methodology,Hypothesis\"]', '2023-01-28 19:42', '1500', '300BF60D-F7DC-40C4-9E2C-FF2E10282785.jpeg_$_5CCD03CF-321A-4B58-930B-3B0C6AA4446F.jpeg_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(758, 828, 'Engineering', 'Organisations and Systems Assignment ', 'The tools and techniques covered within the module organisations and systems are aimed at investigating, understanding and modelling of organisations and systems.\r\n\r\nYou are therefore required to critique each of the following tools and techniques (please note each tool and technique has an equal weighting) and critically discuss how each of the tools/techniques might be used in analysing the Volvo Self-Driving (Autonomous) Car Project. See below for further information.\r\nTools:\r\n1.	SWOT Analysis\r\n2.	PESTEL\r\n3.	Porters Five Forces analysis\r\n4.	Data Modelling\r\n5.	Process Modelling\r\nTechniques:\r\n1.	Interviewing (as part of an investigatory study)\r\n2.	Questionnaires (as part of an investigatory study)\r\n\r\nAppendices\r\nIn addition, you are required to submit appendices which represent evidence of the practical application to the tools to the given case study, which you should also refer to in the main body of the appraisal. Please note that each appendix submitted must have been clearly developed by yourself.\r\n(Please note appendices do not count towards the word count)\r\n\r\nPart 2 (20%) â€“ Organisational and Systems analysis â€“ Tools/Techniques applied (600 words + - 10%)\r\n \r\n\r\n\r\nPart 2 of the assignment is split into two parts (part 2a and part 2b) and can be based on (in) an automotive manufacturing organisation of your choice:\r\n\r\nPart 2a. â€“ Soft Systems - Rich Picture (10%)\r\nChoose an automotive organisation / business and generate a â€˜Rich Pictureâ€™ which portrays the customer/supplier/manufacturer relationship e.g. Innoson Motors. Your analysis should be drawn from the perspective (viewpoint) of the customer who is using the products or services and should consider points of potential conflict and inter connectivity between the different parties, customer / supplier /Manufacturer.\r\nPlease state any assumptions you make when producing the model.\r\n\r\nPart 2b. â€“ Workshop Planning (10%)\r\nYou have been asked to plan a 90 minute workshop involving staff from the organisation of your choice. This workshop aims to develop a better working relationship between the management and staff within the organisation, prior to the introduction of new working practices. You are therefore required to set out a plan and briefly discuss how you would run this workshop, from the opening introductions to facilitating the discussion and finally to how it would be concluded. This can be submitted bullet point form and a maximum of three pages long.\r\n', 'Msc in Project Management', 'Masters', '[\"Report Writing\"]', '[\"Project Management\"]', '2023-01-31 17:00', '5000', 'VOLVO-Fortune.pdf_$_ENGM115 Assignment 112022.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(759, 829, 'Commerce', 'Ethical Poster ', 'Identify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n \r\nIdentify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\nUsing two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n \r\n \r\nA1 Individual submission of a Poster and supportive references.\r\n \r\nThe PDF format of the A1 to be submitted to the dropbox by February 1st 2023, 11pm\r\n \r\nA Word Document supporting your PDF Poster submission listing all academic references (linked to the in-text citations listed on your Poster) to be submitted by at same time as your Poster submission.\r\n \r\nSubmission Arrangements\r\n \r\nPlease ensure the format is PDF as any other format cannot be retrieved for viewing.\r\nPlease ensure the poster is within the set boarder (margins) of an A1 Poster to ensure content fits\r\nPlease check the supporting list of references in the supporting Word Document align to the in-text citations listed in the Poster presentation.', 'Finance', 'Masters', '[\"Report Writing\",\"Research Paper\",\"Case Studies\",\"Other\"]', '[\"Finance and Banking\"]', '2023-02-01 16:00', '5000', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(760, 830, 'Arts', 'Traditional practice of Fishing community in Mumbai', 'As the original inhabitants of Mumbai, they are spread across a number of\r\n  historic fishing villages on the cityâ€™s coast. Fishing community have steadily been\r\n  marginalised. Mumbaiâ€™s\r\nofficial development plan\r\nignores the role of the Koli community\r\n and the environmental impact on their traditional fishing practices, leading to threatening of\r\n their livelihoods and traditional fishing practices.', 'Ba political science ', 'Bachelors', '[\"Dissertation Writing\"]', '[\"Political Science,Fishing practice in mumbai\"]', '2023-02-01 14:35', '4k', 'D0498E69-40B9-49D3-9754-524B8871C141.png_$_CED29BEA-5BB4-477F-9A5C-C7B1416AF20E.png_$_3DE9A9F3-C2D4-448D-BBEB-7D2641783D8D.jpeg_$_C5AC454D-8147-4E25-A969-0F3585EB73F5.png_$_38193E5D-DFF1-4972-9B52-00E5C6C24F27.jpeg_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(761, 831, 'Arts', 'Impact of forest conservation policies of the government on traditional handicraft of the bhotiya community ', 'So I have to write about the impact of forest conservation policies on the traditional handicraft of the bhotiya community in the Nanda Devi biosphere region. I have collected primary data through the means of a questionnaires and interviews myself. I want you to write the introduction, literature review and data analysis of the dissertation.', 'BA (POLITICAL SCIENCE)', 'Bachelors', '[\"Dissertation Writing\"]', '[\"Dissertation,Data analysis,Literature review\"]', '2023-02-02 18:30', '5k ', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
(762, 832, 'Commerce', 'Sahara Group India (company)      Ethical Poster ', 'The assessment has been designed as an opportunity to demonstrate your ability to analyse and apply to your chosen profession the ethical code of conduct, best practice & safeguards, via capturing and analysing an ethical issue, whilst demonstrating your understanding of how UN Global Goals for sustainable development align to ethics.\r\n\r\n The assessors will want you to evidence the following learning outcomes (b)(c) and (f): That youâ€¦\r\n\r\nUnderstand and explore how aspects of their discipline contribute to one or more of the UN Global Goals for Sustainable Development.\r\n\r\nDemonstrate a critical awareness of professional body ethical guidelines and how these apply in practice.\r\n\r\n Develop the capacity to reflect on action so as to engage in a process of continuous learning.\r\n\r\nIdentify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n\r\n \r\n\r\nIdentify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\n\r\nUsing two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n \r\nA1 Individual submission of a Poster and supportive references.\r\n\r\nA Word Document supporting your PDF Poster submission listing all academic references (linked to the in-text citations listed on your Poster) to be submitted by at same time as your Poster submission.\r\n\r\n\r\nSubmission Arrangements\r\n\r\n Please ensure the format is PDF as any other format cannot be retrieved for viewing.\r\nPlease ensure the poster is within the set boarder (margins) of an A1 Poster to ensure content fits\r\nPlease check the supporting list of references in the supporting Word Document align to the in-text citations listed in the Poster presentation.\r\n   \r\n\r\nPlease go through all the references provided thoroughly.\r\nThe poster should be plagiarism free.\r\nMake proper citations of references used.\r\nRead all the instructions provided above and do it accordingly.\r\n', 'Finance and Investment Banking', 'Masters', '[\"Other\"]', '[\"Finance\"]', '2023-02-01 09:30', '4500', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
