(768, 838, 'Engineering', 'Agricare ', 'Write a research paper for Machine Learning and IOT combined project called AGRICARE.A Web application is created using Python-Flask Framework and frontend technologies of HTML,CSS,JS.\r\n\r\nIt has features such as \r\n1.Crop Prediction - Crop predicted using Logistic regression Machine learning algorithm using inputs of Nitrogen, Phosphorous, Potassium, pH, Rainfall ,Temperature.\r\n\r\n2. Fertilizer Prediction - Fertilizer predicted using Logistic regression Machine learning algorithm using inputs of Nitrogen, Phosphorous, Potassium, Crop for which the fertilizer is required.\r\n\r\n3.Disease Prediction - Photos of infected leaves should be uploaded and the disease is predicted using open cv in Machine Learning.\r\n\r\n4.Agri-Hub - In this feature we have enlisted the Government centers in different regions of Maharashtra where the farmers can test the soil and get the readings for their soil.\r\n\r\n5.Smart Irrigation System:-\r\nTo make the sustainable irrigation system and old monitoring system for getting better crops growth as well as best production, this IOT based Automatic irrigation system is proposed. In this system IOT and WSN are used to control and monitor the irrigation system. IOT is used to obtain stored data monitoring and real time monitoring of various contents of soil. WSN is used to make a fully wireless system to make a user-friendly system to cultivate and irrigate water properly to the eld.  Different kinds of sensors are used. This report presents a fully automated irrigation system which is controlled and monitored by using â€œThing speak Cloud Serverâ€. Temperature and the humidity content of the soil are frequently monitored.\r\n\r\nA Web application is created using Python-Flask Framework and frontend technologies of HTML,CSS,JS.', 'IT Engineering', 'Bachelors', '[\"Research Paper\"]', '[\"Machine Learning Using Python\"]', '2023-02-10 10:00', '5000', 'Report_Siddhi.docx_$_MAJOR PROJECT PRESENTATION -1.pptx.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 1, 0, 0),
