(814, 886, 'Engineering', 'Assignment Part 1: Weather Data assessment : Solar Radiation Calculations', 'This part of the coursework involves solar radiation calculations using excel spreadsheet, or a similar computer program for a given location. You may choose any location for this task.\r\nSolar radiation data calculations\r\nYou may assume that, the solar radiation data are not available for the site under consideration, and you are required to calculate these based on the extraterrestrial solar radiation, using a value of 1367 Wm2 for the solar constant. You are required to calculate a whole year solar radiation data, and check these for accuracy using data from any other sources. You may calculate solar radiation for one or more days for each month of the year, as you would like. The data must be presented appropriately, e.g., for sample days of each month, and monthly average or total values. Use appropriate values for ground reflectivity and clear sky index (from NASA website or any other sources). Explain the procedures that you have followed to calculate the solar radiation on a surface of an appropriate tilt angle to the horizontal that suits the location and give sample calculations for each step.', 'Sustainable Energy', 'Masters', '[\"Report Writing\",\"Primary / Secondary Data Analysis\",\"Other\"]', '[\"Sustainable Engineering\"]', '2023-03-14 12:00', '4000', 'ABEE4090 - Introduction to Energy Resources_HO 2022-2023.pdf_$_Sample Spread sheet calculation for Solar Radiation_for Moodle.pdf_$_ABEE4090 - Solar Thermal Design Exercise Handouts.pdf_$_How to Obtain NASA Website solar Weather Data.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
