(848, 924, 'Commerce', 'risk and crisis management ', 'BUSM117 2023 Coursework assignment Instructions and guidance\r\nThe coursework assignment is worth 40% of the total mark for this module.\r\nSources\r\nFor both the coursework assignment and for the examination, you must ONLY use the literature listed in the reading lists in this module handbook for all conceptual and theoretical points.\r\nFor your case studies, however, you may use other peer-reviewed sources or other reputable, well-researched sources.\r\nDo not use practitioner web sites as sources for your assessments.\r\nWord limit\r\nMarks may be deducted if you overshoot the word limit. For the sake of clarity, unlike on some modules there is no percentage allowance for excess words: the limit is 2000 words exactly. (For the sake of clarity, unlike on some modules there is no percentage allowance for excess words: the limit is 2000 words exactly.)\r\nThis does not include reference lists and bibliographies although citations in the main body of your assignment do count. The words in the question itself, which will be your title, do not count against the word limit.\r\nDo not include a summary at the beginning of the essay, as well as your introduction: that would count against the word limit, and you would risk a deduction of marks for repetition.\r\nDo not use appendices: they would also count against the word limit and in any case the evidence supporting your argument should be in the main body of your essay.\r\nGuidance on the coursework assignments\r\n1. To answer any of the coursework questions, you will need to draw upon your learning from the seminars. You should expect to use examples which you examined in preparatory study for and in discussion during the seminars for this module.\r\n2. Use and compare two or three case studies to illustrate and support your arguments. You can draw cases from the articles and books suggested in the reading lists, in particular from the reading lists for the seminar tasks. Supplement the information on these cases by searching using the QMUL library, to find additional peer reviewed articles and also look for major investigative reports.\r\n3. Donâ€™t just describe. Focus your answer on causal processes which explain the outcomes for risk management which you want to argue in, in response to the specific question set.\r\n4. Ensure that your answer draws on material covered week 1-8 of the module.\r\nCoursework questions\r\nSelect one of the following three questions and write an essay of not more than 2000 words in answer to it.\r\n1. Enterprise risk management: Assess the evidence for and the limitations of the main arguments made by at least three advocates and by at least three critics of enterprise risk management (ERM). In particular, assess the evidence for their rival claims about its\r\n\r\npracticality in implementation, effectiveness and capacity to limit the effect of bias, for different kinds of businesses and organisations, for different kinds of risks, and for different phases of the business cycle.\r\nSupport your analysis of the strengths and weakness of the advocatesâ€™ and the criticsâ€™ cases by comparing either cases of attempts to implement ERM either in (a) two contrasting industries or (b) in two firms of very different sizes.\r\n2. Risk perception / communication: Under what conditions and with what risk communication strategies, if any, can companies succeed in reassuring consumers who are sceptical of the safety of a companyâ€™s products or services and local residents living or working near a companyâ€™s hazardous site or plant or operations?\r\nSupport your analysis by comparing evidence about conditions for success and strategies from two industries, one of which should be concerned with risk communication to consumers about product or service safety and the other with risk communication to local residents about operational safety. Both cases should concern routine business work, not crisis or post-crisis conditions. Identify key differences and similarities between these contexts.\r\n3. Project risk in mega-projects: Why does the implementation of project risk management procedures so often fail to reduce project risks in mega-projects? Review empirical evidence from research and assess the relative importance of at least four different factors.\r\nSupport your analysis by comparing cases of more and less successful mega-projects, where risk management procedures were implemented in each case, even in the less successful project.\r\nGeneral advice\r\n- Answer the exact question set.\r\n- Structure your essay carefully, with a clear introduction that â€˜signpostsâ€™ the sequence of the argument to be made out, a main body of argument, and a conclusion which integrates the whole argument.\r\n- Support your answer with carefully marshalled, ordered and sequenced presentations of empirical evidence, setting out your reasons for answer to the question in full.\r\n- Use empirical cases and evidence to illustrate your argument.\r\n- Use the literature in the field critically.\r\n- Define and explain key concepts when you introduce them.\r\nCommon mistakes to avoid\r\n1. Being vague â€“ e.g., failing to define key terms, writing obscurely, failing to be clear and unambiguous.\r\n2. Over-claiming â€“ claiming too much, claiming more than your evidence really supports.\r\n3. Asserting rather than arguing â€“ failing to support your claims with empirical evidence\r\nand logically related reasons.\r\n4. Swithering â€“ arguing for one answer to the question set in one part of the essay and\r\nthen arguing for a quite different or even opposite answer in another part of the essay.\r\n5. Being indecisive â€“ writing a â€˜on the one hand ... and on the other ...â€™ answer to the\r\nquestion set that does not come down clearly in favour of one answer to it.\r\n6. Not considering the limitations of at least one opposing case, if only briefly.\r\n\r\n7. Presenting a conclusion that does not follow from the argument or the evidence.\r\n8. Trying to rely on knowledge drawn from other modules.\r\n9. Writing without a well-thought out structure â€“ e.g., no evident and logical sequence of\r\npoints that build up to a step-by-step argument to a conclusion.\r\n10. Being uncritical and not being thoughtful â€“ e.g., taking the conventional â€˜textbookâ€™\r\nwisdom for granted, without interrogating it, without examining whether the evidence\r\nsupports it.\r\n11. Summarising â€“ just summarising what leading authors have written, without making an\r\nargument of your own.\r\n12. Writing about the topic rather than answering the exact question set.\r\n13. Being too simple â€“ e.g., assuming practice will mechanically follow rules set in laws or\r\nobjectives of programmes, taking simple abstract and theoretical differences between\r\nindustries for granted, over-generalising about fields.\r\n14. Presenting your essay poorly â€“ e.g., writing illegibly, not making your paragraph breaks clear and\r\nobvious, not numbering and indenting key points in those cases where this would be helpful to the reader in understanding some steps in your argument.\r\nFormat\r\nâ–ª All work must be typed and submitted in MS Word or Adobe PDF format\r\nâ–ª Font size should be 12 point (unless otherwise specified)\r\nâ–ª Font style should be Arial\r\nâ–ª Lines should be double-spaced\r\nâ–ª Leave margins for comment Insert page numbers\r\nâ–ª Use a header containing your student ID number, the module code to which your work\r\napplies, and the date\r\nâ–ª Always spell-check and proof read your work before handing it in (once you have\r\nsubmitted your work you will not be permitted to retrieve it)\r\nâ–ª Keep your own electronic back-up copy of your work and if possible save on two\r\ndevices\r\nâ–ª Avoid plagiarism\r\nâ–ª Submit your work on time\r\nLate submissions\r\n1. Coursework submitted late (and there are no extenuating circumstances) will incur a late penalty. Five per cent of the total marks available shall be deducted for every period of 24 hours, or part thereof, that an assignment is overdue there shall be a deduction of five per cent of the total marks available (i.e. five marks for an assessment marked out of 100). After seven calendar days (168 hours or more late) the mark shall be reduced to zero, and recorded as 0FL (zero, fail, late).\r\n2. Each module has word limits for coursework assignments; however, the decision about whether to impose a penalty mark for exceeding the word limit is made by each module organiser. You must check the module handbook and the assignment briefing documents to see whether the particular module organiser has adopted a penalty system. It is your responsibility to read the handbook and assignment briefing carefully. If no penalty is specified then the module organiser will take into account the word length under the standard marking conventions. For example, if you have exceeded the word limit then it might be that you have not been sufficiently succinct or focused in your assignment and therefore might be penalised for these weaknesses. Please note that word limits do NOT\r\n\r\n3. 4.\r\n5.\r\n6. 7.\r\n8.\r\ninclude references or appendices. However if excessive material is included on appendices then this too will be judged accordingly and you may be awarded a lower mark.\r\nYou should ensure that your submission is in either Microsoft Word or PDF format. Failure to submit in either one of these formats will result in a mark of 0 being awarded for the particular assessment. It is therefore your responsibility to ensure that the file format is correct and it can be opened by the receiving party.\r\nYou should ensure that the correct piece of assignment is uploaded as the document downloaded on the due date by the module organiser will be marked regardless of content. You will not have another opportunity to submit the work again if you mistakenly uploaded the wrong document.\r\nALLOW YOURSELF PLENTY OF TIME TO SUBMIT YOUR COURSEWORK. DO NOT LEAVE IT UNTIL THE LAST MINUTE\r\nComputer problems, such as computer viruses, failure to make a back-up copy or temporary internet access problems, will NOT be viewed as a valid reason for late submission.\r\nCheck that your assignment submission has been successful, and print a copy of the confirmation screen.\r\nIf you\r\nvia QMplus however you will be penalised for late submission, the only exception to this is if you have an approved extension due to extenuating circumstances.\r\nsubmit your assignment after the deadline, you will still be able to submit your coursework\r\nSubmission deadline\r\nDate\r\nTime\r\nQMplus Link/Page\r\nEstimated 29th March 2023\r\nEstimated 1600pm\r\nTbc â€“ Assessment information tab in BUSM117 QMPlus page\r\n\r\n                Marking criteria for both the coursework assignment and the examination\r\nThe marking criteria for the coursework assignment and for the examination are the same. They are set out in the following table, which you will also see used to provide feedback on your assignment and to explain the mark given. For both the coursework assignment and for the examination, you must ONLY use the literature listed in the reading lists in this module handbook for all conceptual and theoretical points. For your case studies, however, you may use other peer-reviewed sources or other reputable, well-researched sources. Do not use practitioner web sites as sources for your assessments.\r\nMarking criteria by grade\r\nband\r\nEvidence of learning from\r\nlectures, seminars, module\r\nmaterials and guidance from\r\nteaching staff\r\nNOT % of mark but\r\ncondition for pass\r\n18%: Argument from\r\npremise to conclusion, focus\r\non explanation / evaluation\r\n(as appropriate to the\r\nquestion set) not just\r\ndescription\r\n18%: Analysis, synthesis and\r\ncritical thinking\r\n18%: Answers the precise\r\nquestion set\r\n18%: Knowledge and\r\nunderstanding of the\r\nsubject, showing wide\r\nreading\r\n80-100 70-79.9 Strong distinction Distinction\r\n60-69.9 Merit Present\r\nArgument structure clear and strong Principally explanatory / evaluative\r\nVery good analysis, synthesis and critique\r\nAnswers the precise question set, even if some irrelevant material\r\nCompetent\r\nknowledge of the\r\nsubject\r\nEvidence of\r\nreading, mainly\r\nrelevant\r\n50-59.9 Pass Present\r\nArgument structure either clear or strong but not both Largely descriptive\r\nGood analysis, synthesis and critique\r\nLargely answers the precise question, even if some irrelevant material, and lacking some relevant material Some weaknesses in knowledge of the subject Insufficient reading, or some irrelevant items\r\n45-49.9 Bare fail Present\r\nArgument structure lacking in clarity and / or strength Mainly descriptive\r\nWeak analysis, synthesis and critique Answers a closely related question but not the precise question set\r\nSerious weaknesses in knowledge of the subject Severely insufficient reading, or significant number of irrelevant items\r\n40-44.9 Weak fail Present\r\nArgument poorly structured Purely descriptive\r\nPoor analysis, synthesis and critique Fails to answer the precise question set\r\nVery severe weaknesses in knowledge of the subject Lack of reading, or lack of relevant items\r\n0-39 Very poor fail Absent\r\nNo clear argument Purely descriptive, perhaps vague even in description\r\nVery poor analysis, synthesis and critique Fails to answer a clear question\r\nLack of knowledge of subject Little evidence of reading, or irrelevant items Fundamental misunderstandings\r\nPresent\r\nArgument structure\r\nvery clear and\r\nstrong, high level of\r\nrigour in inference\r\nFocused exclusively\r\non explanation /\r\nevaluation\r\nExceptional\r\nanalysis, synthesis\r\nand critique\r\nAnswers the precise\r\nquestion set, no\r\nirrelevant material\r\nExceptional\r\nknowledge of the\r\nsubject\r\nVery wide reading\r\nof strongly relevant\r\nitems\r\nPresent\r\nArgument structure very clear and strong Focused exclusively on explanation / evaluation\r\nExcellent analysis,\r\nsynthesis and\r\ncritique\r\nAnswers the precise\r\nquestion set, no\r\nirrelevant material\r\nStrong knowledge\r\nof subject\r\nWide reading of\r\nrelevant items\r\nShows no\r\nmisunderstandings\r\n\r\n        18%: Comparative, structured analysis of cases to support the argument, based on a clear principle of case selection\r\n10%: Essay clearly and well\r\nstructured, logically ordered\r\nwith sub-headings reflecting\r\nclear principles\r\nShows no misunderstandings\r\nExceptionally clear, well presented with structured case Exceptionally strong, appropriate, well-presented and defended principle for selecting cases analysis format Powerfully analytical structure of comparison among cases\r\nVery strongly,\r\nclearly logically\r\nstructured,\r\nheadings grounded\r\nin clear principles of\r\ninference from\r\nevidence to\r\nconclusion\r\nClear, well presented with structured case analysis format Strong, appropriate, well-presented and defended principle for selecting cases Good analytical structure of comparison among cases\r\nStrongly, clearly logically structured, headings grounded\r\nin clear principles of inference from evidence to conclusion\r\nShows no or very few and only minor misunderstandings\r\nClear cases well presented, an appropriate, well- presented principle for selecting cases Competent analytical structure of comparison among cases\r\nCompetently structured, headings grounded in some principles of inference from evidence to conclusion\r\nSome misunderstandings\r\nCases presented, but some weaknesses in clarity of presentation Case selection principle stated but either not quite appropriate or not well presented Mainly adequate analytical structure of comparison among cases but with weaknesses in organisation Adequately structured, with headings bearing some relationship with logic of argument\r\nSignificant misunderstandings\r\nExamples presented, but weakly organised into case format Fails to set out case selection principle precisely Poorly structured analytical structure of comparison among cases\r\nWeaknesses in structuring and/or in subheadings\r\nMany or serious misunderstandings\r\nExamples mentioned casually, not structured as cases No case selection principle No analytical structure of comparison among cases\r\nSerious weaknesses in organisation and structure of the essay\r\nNo clear cases used Either no case selection principle or serious misunderstanding of case selection No comparison of cases\r\nNo clear organisation or structure to the essay\r\n', 'msc management ', 'Masters', '[\"Essay Writing\"]', '[\"risk-and-crisis-management\"]', '2023-03-27 19:58', '5000', 'BUSM117-guidance-on-how-to-read-articles-and-chapters-when-preparing-for-your-coursework-assignment.pdf_$_BUSM117---coursework-assignment---suggestions-dr-10.pptx_$_BUSM117-2023-Coursework-assignment-Instructions-and-guidance-dr2.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 0, 0, 0, 0),
