(853, 930, 'Commerce', 'Report ', 'Tag sheet is already done.\r\nTopic sponsorship. \r\nArtcile links are below \r\n\r\nhttps://www.sciencedirect.com/science/article/abs/pii/S0148296309000290#preview-\r\n\r\nhttps://www.jisc.ac.uk/core\r\n\r\nhttps://core.ac.uk/download/pdf/38024379.pdf\r\n\r\nhttps://www.researchgate.net/publication/239781417\r\n\r\n\r\n\r\n\r\n\r\nOverview\r\n\r\nYou will choose one Marketing Communication topic out of a list of five, topic in which you will become an â€˜expertâ€™ by researching a range of sources. You will write up an up-to-date, critical review of the academic literature in your chosen topic area, as well as some recommendations to a fictitious company (to be chosen from a list of four) on how this company should take the issues raised in your briefing paper into account in their \r\nfuture marketing communications.\r\n\r\nThe individual assignment comprises of three elements:\r\n\r\n1. A fully-referenced Company Briefing Paper (2,000 words maximum)\r\n\r\n2. A reflective statement on the research process (200 words maximum)\r\n\r\n3. Preparation for and contribution to five â€œExperts and Novicesâ€ roundtables, including a TAG (Thematic Analysis Grid). \r\n\r\n The task\r\n\r\nElement 1 â€“ Company Briefing Paper\r\n\r\nYou should choose one of the topics below as the subject of 2,000 words (maximum) fully-referenced Company Briefing Paper. Your chosen topic designates you as an â€œExpertâ€ at the relevant Roundtable Experts & Novices workshop sessions (see Element 3 below).\r\n\r\nPlease note that a limited number of places will be available for each topic, therefore you should choose a secondary topic as a back-up. A topic sign-up list will be available on Canvas closer to the time.\r\n\r\nÂ· Brand placement\r\n\r\nÂ· Sponsorship\r\n\r\nÂ· Ethics in Marketing Communications\r\n\r\nÂ· Customer Journey Communications\r\n\r\nÂ· Interactive/Digital & mobile communications\r\n\r\n \r\n\r\nThe Company Briefing Paper must be written in the 3rd person and provide the Marketing Director of a fictitious company (see below for choice of companies) with the following:\r\n\r\nAn up-to-date, critical review of the academic literature in your chosen topic area\r\ndrawing on an absolute minimum of two carefully selected academic journal \r\narticles and on a range of at least ten diverse sources. \r\nIntegrate into your discussion at least two examples of how the academic theory reviewed is used/ applied by brands/ companies in current practice. Here, you should draw on practitioner sources such as the trade press (e.g. Marketing Week), newspaper articles (e.g. The Guardian) and news sources (e.g. BBC), and blogs, articles and websites written by credible industry commentators and experts. \r\nRecommendations for how the fictitious company should take the issues raised in your briefing paper into account in their future marketing communications.\r\nIn this way, your Company Briefing Paper will pull together the academic literature on a topic with examples drawn from marketing practice. Employers put a high value on candidates who can demonstrate skills in critical thinking, synthesising (bringing together) material from different sources, and analysing complex material.\r\n\r\n \r\n\r\nYou should choose any ONE of the fictitious companies shown below as the focal company for your Company Briefing Paper. \r\n\r\nCompany A: Get Fit Now is a new pay-as-you go gym, targeting consumers who have become disillusioned by high joining and membership fees of health clubs. As a newcomer they need to build awareness very quickly and ensure that potential customers understand their position in the market place. \r\n\r\nCompany B: Bio-gloss is a brand of shampoo and hair care products targeted at a young teenage female audience. The products are positioned as fun, stylish, â€œmust-haveâ€ items aimed at encouraging young girls (12-17 years old) to get into a regular hair care routine.\r\n\r\nCompany C: Nice Ice is a chain of ice cream cafes targeted at teenagers and their parents. Positioned as a trendy place to hang out with friends, the chain plans to open 25 outlets in large towns within a year.\r\n\r\nCompany D: Green-Phone is a new brand of smart phone positioned as sustainable. It is targeted at consumers who need to replace their phone whilst reducing their impact on the environment. The companyâ€™s marketing objective is to seize a 10% market share in the mobile phone market in year 1 by building awareness and trial rapidly.\r\n\r\nKey elements of a Company Briefing Paper\r\n\r\nPlease note that this is an indicative list only of what should be included in your work, it is not a running order or list of contents: thus, the logic and flow of material is up to you to decide.\r\n\r\nIntroduction to the paper (what is the purpose of the paper and what it will cover?)\r\nCritical analysis and discussion of academic theory in your chosen topic area. You should aim to focus your discussion on any issue that you consider to be of relevance/ importance/ interest â€“ but â€“ be careful to scope it in. Do not be tempted to cover too many issues. Remember, your aim is to offer a critical discussion, not to simply describe one article after another â€“ thus, you should aim to go for depth rather than breadth. For example, is there an area of controversy or divided opinion in the subject area, e.g. where researchers have found different or conflicting results?\r\nExamples â€“ integrate practitioner sources to demonstrate how the issues raised in your review of the academic literature are used /applied in the case of at least two companies/ organisations/ brands in their marketing communications\r\nConclusions and recommendations: what conclusion do you draw from the review of the academic literature? Based on this, what recommendations would you make to the Marketing Director of your chosen fictitious company?\r\nReferences: ALL sources used in the work must be shown in accurate Harvard style, including the in-text citations and the Reference list at the end of the work.\r\nAppendices are optional and should be used only if there is a need to include any supporting information.\r\nPresentation style â€“ your paper must be presented to professional standards and demonstrate a coherent structure. It should include a title page, contents page, page numbers, and a clear system of appropriate headings and sub-headings.\r\n \r\n\r\nElement 2 â€“ Reflective statement on the research process\r\n\r\nThe Company Briefing Paper requires you to find, evaluate and use information drawn from a range of academic and practitioner sources. The ability to carry out information search and demonstrate reflective professional practice are important skills that employers are looking for.\r\n\r\nFor the reflective statement, therefore, you should write 200 words reflecting on your research process and the trustworthiness of the sources you have used. You should address:\r\n\r\nHow did you judge whether your sources were credible and reliable?\r\nWhat did you learn from the research process in undertaking this assignment?\r\nHow might you take this learning forward into your professional life?\r\n The reflective statement should be inserted in a separate section at the very end of your Company Briefing Paper, after the references and any appendices, and NOT as a separate document.\r\n\r\n \r\n\r\nElement 3 â€“Experts and Novices Roundtable Sessions\r\n\r\nFive Roundtable Experts & Novices sessions in Teaching Block 2 take the form of expert and student-led, co-created workshops, where students take on the role of either an â€œExpertâ€ or a â€œNoviceâ€ and work together to share and develop knowledge about the topics for the Company Briefing Paper.\r\n\r\nFollowing from Element 1 above, your chosen literature review topic designates you as an â€œExpertâ€ at the relevant roundtable session. For the roundtable sessions where the topic is not your chosen literature review topic, you are a â€œNoviceâ€. Everyone will therefore be an â€œExpertâ€ at one session and a â€œNoviceâ€ at the other four sessions.\r\n\r\nAttendance at the Roundtable Expert and Novices workshop sessions is mandatory.\r\n\r\nThe purpose of the workshops is to develop subject knowledge and help you prepare for the assignment. You will also develop your research skills as well as gain confidence in your ability to explain the results of your research to others. Employers place high importance on communication and listening skills, and the Experts and Novices sessions will enable you to practice and hone your talents in both areas. \r\n\r\nIn preparation for the workshops you are required to find and read at least four academic journal papers on your chosen literature review topic and prepare a written summary of your findings in the form of a Thematic Analysis Grid (TAG). \r\n\r\nThe Critical Thinking module on Canvas provides resources to help you produce your TAG, and enrolment on the module is recommended: https://canvas.kingston.ac.uk/courses/7439\r\n\r\nGiven the co-created nature of these sessions, their success depends entirely on everyone taking responsibility for their part in the sessions and the impact of this on others. This means actively participating in the workshops and coming prepared, i.e. having done the reading and produced the required TAG preparation paper. Specifically:\r\n\r\nExperts must find and read at least four academic journal articles* in their chosen topic area and prepare a written summary of these articles in the form of a fully-referenced Thematic Analysis Grid (TAG). In your designated Expert workshop session, you will use your TAG paper as the basis for your explanation about your topic to a small group of Novices.\r\nExperts must also find examples of how brands/companies have used/ applied the theory in practice, to illustrate your findings to your Novices.\r\nNovices must read the relevant content in Fill & Turnbull (2019) or at least ONE academic journal article in order to gain a basic understanding of the topic AND find examples to discuss in class. Be ready to ask questions of your Expert.\r\nDuring the roundtable sessions, after the Experts have shared their findings with the Novices, Experts and Novices will work together to apply the theory to a practical scenario and produce recommendations for practice.\r\nAt the end of every roundtable both Experts and Novices are required to complete a Contribution Sheet that reflects on your input into the sessions and what you got out of them. You must submit a satisfactory Contribution Sheet in order to gain your marks for each workshop roundtable.\r\n \r\n', 'Bba', 'Bachelors', '[\"Report Writing\"]', '[\"Marketing Communication\"]', '2023-03-24 09:19', '4000', '90B8737C-BCE6-40E3-BD29-6512FADBCFC5.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
