(856, 933, 'Arts', 'Environmental and social risk management : new frontiers of decision making ', 'Topic should cover following key points:\r\n1/ Municipal solid waste management.\r\n2/ Circular economy \r\n3/ Energy Recovery \r\n4/ Decision Making \r\nThe research paper should include \r\n1/ case study. \r\n2/ how and when it is used/ applied. \r\n3/ itâ€™s effectiveness \r\n4/ analytical framework \r\n5/ critical evaluation \r\n6/ social risk management involved \r\n7/ social risk management \r\nIt should include 10 min of presentation and 500 words of reflection. \r\n', 'MSc environmental impact assessment and management ', 'Masters', '[\"Research Paper\"]', '[\"Municipal-solid-waste-management,circular-economy,energy-recovery,decision-making,Social-risk-management,sustainability-assessment\"]', '2023-04-03 10:30', '5000 INR', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 0, 0, 0, 0),
(857, 934, 'Arts', 'The Digital Transformation: Towards Intelligent Impact Assessment', 'Using computer assisted text mining methods, this assignment requires you to analyse the initial consultation responses (â€œRelevant Representationsâ€) associated with a Nationally Significant Infrastructure Project (NSIP) and produce a technical report of not more than 1500 words.', 'MSc environmental impact assessment and management', 'Masters', '[\"Report Writing\"]', '[\"Technical-report,Nationally-Significant-Infrastructure-Project,Digital-Transformation\"]', '2023-03-31 10:30', '2000 INR', 'EIAM7004 Assignment 2 - Brief 2022-23 (1500).pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
