(867, 945, 'Arts', 'Reaction Paper ', 'The font has to be Times New Roman, justified aligned, size 12, 1.5 spacing and the length must be between 1.5 to 2 pages (500-800 words approx). You have to mention your names and your ID on top of the reflection papers. They have to be submitted any time before the commencement of the classes that discuss the readings that particular week. Keep it lucid, simple, have a provocative title to keep things interesting and avoid summarizing or paraphrasing. You can use any essential readings for your critique and pull out a single theme or two, in a well articulated op-ed style essay that illustrates your learning experience and justified reasoning. If you do wish to cite, just a footnote (last name, year followed by a footnote) will do.', 'Law', 'Bachelors', '[\"Other\"]', '[\"history-of-courts\"]', '2023-03-31 15:00', 'NA', '- Rohit De, â€œA Peripatetic World Courtâ€ Cosmopolitan Courts, Nationalist Judges and the Indian Appeal   to   the   Privy Cou.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(868, 946, 'Arts', '2nd Reaction Paper ', 'The font has to be Times New Roman, justified aligned, size 12, 1.5 spacing and the length must be between 1.5 to 2 pages (500-800 words approx). You have to mention your names and your ID on top of the reflection papers. They have to be submitted any time before the commencement of the classes that discuss the readings that particular week. Keep it lucid, simple, have a provocative title to keep things interesting and avoid summarizing or paraphrasing. You can use any essential readings for your critique and pull out a single theme or two, in a well articulated op-ed style essay that illustrates your learning experience and justified reasoning. If you do wish to cite, just a footnote (last name, year followed by a footnote) will do.', 'Law', 'Bachelors', '[\"Other\"]', '[\"history-of-courts\"]', '2023-03-31 15:00', 'NA', 'George H. Gadbois, Jr_ edited and introduced by Vikram Raghavan and Vasujith Ram - Supreme Court of India_ The Beginnings-OUP India (2018).pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(869, 947, 'Arts', 'Reflection Paper', 'Critically analyse a news item, a documentary, or a movie in about 1500 words using the concepts discussed as part of the course. Critically engage the chosen movie, documentary, or news item using at least ONE text that is part of the syllabus. Do NOT pick a news item or any audio-visual material that has already been discussed in class.Â \r\nA good essay will show a concise and clear interpretation of the material, a thorough and critical engagement with the concept and the text as well as clarity in thinking and writing. Use of sub-headings is encouraged as it helps in organising the material in an essay.Â ', 'Law', 'Bachelors', '[\"Other\"]', '[\"foundations-of-social-sciences\"]', '2023-03-30 12:00', 'NA', 'Ehrenreich-Barbara-English-Deirdre-For-Her-Own-Good_-Two-Centuries-of-the-Experts-Advice-to-Women-.pdf_$_05-federici.pdf_$_04-federici.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(870, 948, 'Arts', 'Research Paper', 'Based on any one of the films (taste of cherry by Abbas Kiarostam) prescribed in the syllabus or Arthur Millerâ€™s play The Crucible â€“ along with the help of secondary sources, the students are expected to write a research/academic essay.\r\nThe research paper must engage with a primary text (film or play), along with at least five (5) secondary sources (at least 3 print sources from JSTOR, Project Muse, etc. and 2 credible online sources). The essay should consist of an Introduction (including the thesis statement), main body of the essay (no limit to the number of paragraphs you could write), and a conclusion. The research paper must demonstrate research and follow the Thesis-Evidence-Evaluation model.\r\nThe secondary sources are meant to either support your argument or to be used as a counterargument. In any case, it is better to use them as enabling evidence. Your own voice must not be drowned out by the secondary sources, that is, your paper should not become a mere repetition and summing up of the claims in the secondary sources. You may either quote directly some lines from the secondary sources or sum up their ideas.\r\nWhether you quote directly or sum up the main ideas in secondary sources, you must cite them in your essay. Otherwise, it will be an act of plagiarism, which will invite severe reprimand in the form of failing or deducting marks.\r\nThe essay must follow either MLA or Chicago style guide for both in-text citations and Works Cited/Reference guidelines.  \r\nCredits will be given for originality and creativity.', 'Law', 'Bachelors', '[\"Other\"]', '[\"English-2\"]', '2023-04-05 16:30', 'NA', 'Assignment #2_Research Paper.doc_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 0, 0, 0, 0),
