(873, 951, 'Engineering', 'DESIGN AND ESTIMATION OF BIOGAS PLANT FOR AN EDUCATIONAL COMPLEX', 'We required Research Paper on biogas, which is rapidly used as an alternative source of energy.\r\nPresent study shows the problem statement of MSW, then the market survey of the materials required for the construction of fixed dome type of biogas plant for BRHCET , here we have considered all the required aspects to be considered for construction of biogas plant, next is the analysis part which includes the calculations   in which information collection about the different waste generated in our complex and their quality is studied and estimation and costing of the materials is done, after comes the working of fixed dome type biogas plant specifically Anaerobic digester.', 'Civil Engineering', 'Bachelors', '[\"Research Paper\",\"PPT Making\"]', '[\"Civil Engineering Cost Analysis\"]', '2023-04-09 12:00', '2000', 'DESIGN AND ESTIMATION OF BIOGAS PLANT FOR AN EDUCATIONAL INSTITUTE (5).pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 0, 0, 0, 0),
(874, 952, 'Commerce', 'risk and crisis management assignment ', 'To answer any of the coursework questions, you will need to draw upon your learning from the seminars. You should expect to use examples which you examined in preparatory study for and in discussion during the seminars for this module.\r\n2. Use and compare two or three case studies to illustrate and support your arguments. You can draw cases from the articles and books suggested in the reading lists, in particular from the reading lists for the seminar tasks. Supplement the information on these cases by searching using the QMUL library, to find additional peer reviewed articles and also look for major investigative reports.\r\n3. Donâ€™t just describe. Focus your answer on causal processes which explain the outcomes for risk management which you want to argue in, in response to the specific question set.\r\n4. Ensurethatyouranswerdrawsonmaterialcoveredweek1-8ofthemodule\r\n\r\n\r\n\r\n\r\n\r\nQUESTION - Risk perception / communication: Under what conditions and with what risk communication strategies, if any, can companies succeed in reassuring consumers who are sceptical of the safety of a companyâ€™s products or services and local residents living or working near a companyâ€™s hazardous site or plant or operations?\r\nSupport your analysis by comparing evidence about conditions for success and strategies from two industries, one of which should be concerned with risk communication to consumers about product or service safety and the other with risk communication to local residents about operational safety. Both cases should concern routine business work, not crisis or post-crisis conditions. Identify key differences and similarities between these contexts.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nThis has a few files. The first 3 pdfâ€™s basically talks about how to approach the question and what to do. The literature file is basically are the materials from which we should base about arguments from. The third file is of case studies. We should choose 2 or 3 from those Write a report on', 'MSC MANAGEMENT ', 'Masters', '[\"Essay Writing\",\"Report Writing\",\"Case Studies\"]', '[\"Risk Analysis and Management,Risk Management,Risk analysis and modeling\"]', '2023-03-27 05:00', '4500', '2.zip_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
