(908, 988, 'Commerce', 'Understanding Consumer Behaviour', ' TOPIC : Consumer attitude towards sustainable packaging in UK market. We have to identify and evaluate a contemporary societal challenge that is influencing the consumption behaviour of consumers which I want to choose is sustainability further classifying as sustainable packaging and then we have to develop conclusions from our evaluation around this topic and further use these conclusions to develop a â€˜future imaginationâ€™ of how consumers and their behaviour will evolve in the future in response to this challenge, and how marketing will need to adapt to continue to engage with them. Basically it should include; consumer perception of the effectiveness of sustainable packaging in reducing environmental impact, consumer willingness to pay more for products with sustainable packaging, marketing strategies for promoting sustainable packaging to consumers, ethical considerations in sustainable packaging decisions, and sustainable packaging initiatives and regulations by government and industries.', 'MSc Marketing', 'Masters', '[\"Essay Writing\"]', '[\"Understanding-Consumer-Behaviour\"]', '2023-04-15 13:00', '3000-3500', 'MARK7013 HB S2 2022-23 (1).docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(909, 990, 'Commerce', 'Strategic Brand Management', 'We have to help Royce Lingerie prepare for a future brand positioning\r\nthat takes latest broader societal trends as well as a comprehensive market analysis into account. focusing geographically on the UK market only. We have to do brand analysis which should include the brandâ€™s IDEOLOGY, CAPABILITIES,CONSUMERS/STAKEHOLDERS, COMPETITION and ENVIRONMENT; based on  analysis, we are expected to discuss two different potential future positioning options for the brand which could be established in the UK market in autumn/winter 2023. You then need to justify/evaluate which of the discussed positioning has the most potential, i.e. you need to choose one positioning option and justify your decision, in this context you must apply one or more of the following frameworks: (a) SBM Vision, Mission & Values; (b) SBM Brand Pyramid; and/or (c) Transformation Grid and then do the implementation, One implementation activity needs to utilise social media-based communications or other latest digital technology. ', 'MSc Marketing', 'Masters', '[\"Report Writing\"]', '[\"Strategic-Brand-Management\"]', '2023-04-20 13:00', '5000-5500', 'CONFIDENTIAL Royce OrganizationChart.pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
