(918, 1000, 'Commerce', 'Pressing issue facing global brands in todays digital landscape ', 'A five page executive summary addressing pressing issue facing global brands in todays digital landscape. \r\n\r\nThe issue: with the rising costs of advertising on platforms such as Facebook and Instagram, marketers are having to test emerging channels to find growth opportunities. \r\n\r\nHow can you test, validate, resource and scale these emerging channel?\r\n\r\nPick one platform/channel and discuss. ', 'MSc International Marketing ', 'Masters', '[\"Other\"]', '[\"Digital Marketing\"]', '2023-04-25 00:00', '2500 ', 'image.jpg_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(919, 1001, 'Commerce', 'Global business environment ', 'Choose ONE of the four assignment topics below.\r\nTopic 1: Select a multinational firm operating in a foreign countryâ€”for instance, Tesla in China\r\n1) Analyse how key factors in the two dimensions of the business environment (e.g., political and technological) influence the competitive forces in the two dimensions of the industry where the selected firm is operating (e.g., threat of new entrants, bargaining power of customers).\r\n2) Discuss the past strategies of the firm that respond to the opportunities and threats arising from those environmental changes and suggest the future strategies of the firm.\r\nOR\r\nTopic 2: Select a digital platform firm which is born globalâ€”for instance, AirBnB\r\n1) Analyse the disruptive effects of digital technology on the global industry boundary where the selected firm is operating in the three analytical dimensions (i.e., competitors/complementors/customers).\r\n2) Discuss the firmâ€™s platform AND global strategies that respond to the opportunities and threats arising from these disruptive changes.\r\nOR\r\nTopic 3: Select two competitor firms. One is a catch-up firm from emerging economies and the other is an incumbent firm from advanced economies (e.g., Huawei and Ericsson)\r\n1) Analyse the effects of globalisation AND digitalisation on the industry where the selected firms are competing.\r\n1\r\n\r\n2) Compare and discuss the selected firmsâ€™ catch-up AND defensive strategies that respond to the opportunities and challenges arising from the effects of globalisation and digitalisation.\r\nOR\r\nTopic 4: Select a global firm that operates in multiple countries (e.g., TikTok)\r\n1) Analyse the causes underpinning the rise of the technonationalism around the world in recent years.\r\n2) Discuss how the rise of the technonationalism has affected the firmâ€™s global strategies to operate in foreign countries (e.g., the selection of international markets and partners). Also suggest the firmâ€™s future strategy to manage potential risks arising from those challenges (e.g., international standardisation and localisation).', 'Msc', 'Masters', '[\"Essay Writing\",\"Research Paper\"]', '[\"Business Management\"]', '2023-04-23 12:00', 'Negotiable', 'MGT5179_1A Individual Essay Assignment Question (1).pdf_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
