(933, 1015, 'Arts', 'Menu analysis report', 'create your own menu for a fine dine Indian setup using 2 different international cuisines other than what were mentioned earlier. Put menu in annexure or report.\r\nExplain why this menu will be feasible in a 5 star setting in India\r\nThe cuisine for the menu would be( mexican and italian)^^\r\n\r\nAnd how international food dishes and cuisines are being accepted by Indians and concluding remarks on factors making it famous. \r\n\r\nWrite 1500 words', 'Culinary arts', 'Bachelors', '[\"Report Writing\"]', '[\"Global-cuisine-managment\"]', '2023-04-07 15:00', '3000', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(934, 1016, 'Commerce', 'Operation management', 'You must select one focal organisation as the subject of your assignment. Where the organisation has different divisions or a disparate product/service offer, you may have to select one specific area of the organisation for study (i.e., you will need to define the scope to be covered in your report). You may also find it appropriate to select by geographical region, or if the organisation has disparate operations, one of these.\r\n\r\nYour report must analyse and evaluate the operations management of an organisation, or of a specific business unit/division, and draw conclusions over the extent to which its operational capability supports its corporate strategy and provides competitive advantage.\r\n\r\n\r\n\r\n', 'Management and Business Analytics', 'Masters', '[\"Report Writing\"]', '[\"Operation management\"]', '2023-04-18 13:00', '30Â£', 'OM_example_70s.pdf_$_OM_example_60s.pdf_$_operation management.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
(935, 1017, 'Commerce', 'Operation management ', 'You must prepare and submit an original business report addressing the tasks identified later in this section, but summarised below.\r\nYour report must analyse and evaluate the operations management of an organisation, or of a specific business unit/division, and draw conclusions over the extent to which its operational capability supports its corporate strategy and provides competitive advantage.\r\n\r\nMy Topic- Harley-Davidson Inc.\r\n\r\nYou must select one focal organisation as the subject of your assignment. Where the organisation has different divisions or a disparate product/service offer, you may have to select one specific area of the organisation for study (i.e., you will need to define the scope to be covered in your report). You may also find it appropriate to select by geographical region, or if the organisation has disparate operations, one of these.\r\n', 'International business ', 'Masters', '[\"Report Writing\"]', '[\"Operation management\"]', '2023-04-12 13:54', '4000', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
