(991, 1077, 'Commerce', 'Research Methods for Management', 'The research proposal requires you to demonstrate your ability to identify, analyse a research problem related to business and management, and to set out a plan for a research project to investigate that problem. The aim of this assessment is to enable you to develop and demonstrate your ability to: (a) diagnose a problem in business and management, (b) arrive at the consequent research questions, (c) determine how to answer these questions by drawing on the academic literature, (d) assess the potential of different research methods and (e) plan a small-scale research project.  \r\nYour report is intended to form the plan for how you might use the literature (by drawing on the ideas and findings of others), design a research project and analyse the findings.  \r\nThis report is among the most challenging assignments set during the M.Sc. programmes. You are being asked to anticipate the issues that will confront you in conducting a small research project. Thus, it is quite different from and more difficult than, writing a conventional coursework paper. The best reports are usually those produced by those students who have devoted considerable thought to the assignment before even beginning to write the report.  \r\n', 'Msc ', 'Masters', '[\"Essay Writing\",\"Report Writing\"]', '[\"Market Research\"]', '2023-04-30 17:30', '4500', 'Assessment BUSM145.docx_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
