(993, 1079, 'Commerce', 'Entrepreneurship ', '\r\nWhat are the essay question choices?\r\nChoose any 1 \r\n\r\n1) Is â€˜transformational leadershipâ€™ the most appropriate model of leadership for the\r\ncontemporary public and/or third sector(s)? Use a carefully selected case study to illustrate your answer and reflect on your own development as a current or future public and/or third sector leader.\r\n\r\n2) Is â€˜distributed leadershipâ€™ the most appropriate model of leadership for the contemporary public and/or third sector(s)? Use a carefully selected case study to illustrate your answer and reflect on your own development as a current or future public and/or third sector leader.\r\n\r\n3) To what extent are private sector-derived models of strategic and performance management appropriate for public sector and/or third sector leaders? Use a carefully selected case study to illustrate your answer and reflect on your own development as a current or future public and/or third sector leader.\r\n\r\nCase studies are factual and verifiable accounts of events (like â€˜storiesâ€™). They do not provide us with definitive generalisable answers to questions, but provide rich, contextual insights. Case studies thereby help us to bring analytical arguments to life, and to avoid overly formulaic and theoretical responses to questions. [The classic text on using case studies in management is Robert K. Yin. (2014). Case Study Research Design and Methods (5th ed.). Thousand Oaks, CA: Sage.]\r\n\r\nFor this essay, cases should illustrate leadership in action during a specified period of change or reform in a particular organisational or sector (maybe in any country) and contain sufficient detail for you to convincingly describe a particular type of leadership practice and its outcomes for the organisation.\r\n\r\nYou can source your case studies from any verifiable and authoritative source, so long as they meet these conditions above. The sources may be online reports or articles, for example from leadership/public administration/voluntary sector journals, from government/NGO publications or sector-practitioner publications (see Module Outline for suggestions).', 'MIM', 'Masters', '[\"Essay Writing\",\"Report Writing\"]', '[\"Leadership\"]', '2023-04-20 15:00', '5000', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 1, 1, 1, 0, 0, 0),
