(995, 1081, 'Engineering', 'Fake Product Review Detection System.', 'Taken a dataset from Kaggle of Amazon Reviews. We have taken review text as a feature and verified purchase as label. have build various machine learning models based on these two columns. evaluated the models on various performance metrics. picked out the best one (Logistic regression with count vectorized) and have deployed that using streamlit. \r\n\r\nChanges to made - \r\n1 - Find Source of the Review (source identification)\r\n2 - Improvement in the UI\r\n3 - Application of the Project\r\n4 - Other ways to detect fake reviews besides this', 'Computer Engineering', 'Bachelors', '[\"Programming / Coding Assignment\"]', '[\"Machine Learning Using Python,Data Analysis with Python\"]', '2023-04-26 16:12', '3000', 'project test.rar_$_', '2023-05-09 21:16:59', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
