(1094, 1185, 'Commerce', 'Case Study', 'Our client is a FinTech/Financial Services company which recently raised Series B funding. We are mandated to hire the CFO/Head of Finance, who reports into founders.\r\n \r\nYour purpose is to build a shortlist to present to the client.\r\n \r\n Ideal Candidate: (INDIAN candidates only)\r\n \r\n10+ years of total experience, preferably from regulated Financial Service organizations.\r\nMinimum 2 years as finance controller/Finance head/CFO experience in an NBFC/fintech is mandatory.\r\nCA or MBA Finance from top tier institute â€“ mandatory\r\nExperience in debt fund raise would be a big plus.\r\nExperience in new age fintech NBFCs would be a plus\r\nHas a deep understanding of Lending Financial Operations and is able to identify early indicators of risks\r\n \r\nDeliverables for case:\r\n \r\n1) Methodology followed.\r\n2) List of 40-50 suitable people in an excel format (Name, Current Organization, Current title, Pedigree, year of experience)\r\n3) Identify your top 5 candidates with a reasonable explanation behind the choices.', 'MBA', 'Masters', '[\"Case Studies\"]', '[\"Sales\"]', '2023-05-09 18:30', '2000/-', '_$_', '2023-05-09 21:16:59', NULL, NULL, 1, 0, 0, 0, 0, 0, 0),
